import './App.css';
import  HeaderComponent  from './components/header/Header.tsx';
import  { ButtonComponent } from './components/buttonComponent/button.tsx'
import { FavoriteButton } from './components/buttonComponent/favoriteButton/favoriteButton.tsx';


function App() {
  return (
    <div className="App">
      <HeaderComponent></HeaderComponent>
      <ButtonComponent 
      id={'love'}
      className={'hello'}
      variant="contained"
      children="&#x2665;"
     />
     <FavoriteButton></FavoriteButton>


    </div>
  );
}

export default App;
